import React from 'react';
import { Genders } from './menus/options'; // Importing Genders from options.js
import './DropdownStyles.css';

const GenderDropdown = ({ onSelectGender }) => {
  return (
    <select onChange={(e) => onSelectGender(e.target.value)}>
      {Genders.map((gender) => (
        <option key={gender.value} value={gender.value}>
          {gender.label}
        </option>
      ))}
    </select>
  );
};

export default GenderDropdown;
